import brain from './brain.svg';
import './App.css';
import SideBarComponent from './SideBar_Module/SideBarComponent.js';
import axios from 'axios';
import { useEffect, useState } from 'react';
import { Container } from 'react-bootstrap';

function App() {

  const [response, setResponse] = useState([])

  useEffect(()=> {
    axios.post('http://127.0.0.1:5000/cohorts',{ 
      "name" : "Proj ENIGMA3 Cortical GWAS",
      "endpoint_id" : "https://enigma-endpoint.disk.isi.edu/enigma_dev/sparql"
  })
    .then((res)=> {
      // console.log(res.data)
        setResponse(res.data);
      });
  });
  return (
    <div className="App">
      <Container>
        <row>
          <col>
            <header className="App-header">
                    <div class="text-center">
                        <img src={brain} className="App-logo" alt="brain" />
                    </div>
                  {
                    response.length>0 ? response.map((result_cohorts) => (<SideBarComponent cohortResult={result_cohorts}/>)) : null
                  }
            </header>
          </col>

          <col>
            <div style="width:75%; background-color:red;">

            </div>

          </col>
        </row>

      </Container>

    </div>
  );
}

export default App;
